import css from 'styled-jsx/css';

export default css`h2 {
  position: relative;
  font-size: 36px;
  font-family: Source Han Sans CN;
  margin-top: 89px;
  padding-bottom: 20px;
  margin-bottom: 60px;
  font-weight: bold;
  color: #333333;
  line-height: 30px;
  text-align: center;
}
