  position: absolute;
  display: block;
  width: 63px;
  height: 3px;
  background-color: #355EA6;
  content: "";
  bottom: 0;
  left: 0;
  right: 0;
  margin: auto;
}
.desc {
  max-width: 1195px;
  font-size: 20px;
  margin-bottom: 90px;
  text-align: center;
  margin-bottom: 16px;
  font-family: Source Han Sans CN;
  font-weight: 400;
  color: #666666;
  line-height: 30px;
}
`
